import React, { Component } from 'react';
import Alertbox from "./alertbox.component";


export default class Donate extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
            <Alertbox />
            <h1>Test</h1>
            </div>
        )
    }
}
